    false,nt"url": null,nt"notes": "This annual narrative report for Okefenokee
    National Wildlife Refuge summarizes refuge activities during calendar year 1979.
     The report begins with an introduction to the refuge and a summary of the yearu2019s
    climatic and habitat conditions.   Land acquisition is also covered in this section,
    as is the system status.  A construction and maintenance section is provided next.
     Habitat management is also covered; croplands, grasslands, wetlands, forestlands,
    other habitats, wilderness and special areas, and easements for waterfowl management
    are discussed.  The wildlife section of the report discusses endangered and/or threatened
    species, migratory birds, mammals and non-migratory birds and others.  Interpretation
    and recreation are also described; topics include information and environmental
    education, recreation, and enforcement.  Field investigations, cooperative programs,
    items of interest, and safety information are provided at the end.",nt"license_title":
